import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext';
import Layout from './components/Layout/Layout';
import ProtectedRoute from './components/ProtectedRoute';
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';
import Dashboard from './components/Dashboard/Dashboard';
import SellerDashboard from './components/Seller/SellerDashboard';
import BuyerDashboard from './components/Buyer/BuyerDashboard';
import AppraiserDashboard from './components/Appraiser/AppraiserDashboard';
import AdminDashboard from './components/Admin/AdminDashboard';
import SupportDashboard from './components/Support/SupportDashboard';

const AppContent = () => {
  const { user, loading } = useAuth();

  if (loading) {
    return (
      <div className="loading">
        <div className="spinner"></div>
      </div>
    );
  }

  return (
    <Routes>
      {/* Public Routes */}
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      
      {/* Protected Routes */}
      <Route path="/" element={
        <ProtectedRoute>
          <Layout>
            <Routes>
              <Route path="/" element={<Navigate to="/dashboard" replace />} />
              <Route path="/dashboard" element={<Dashboard />} />
              
              {/* Seller Routes */}
              <Route path="/seller/*" element={
                <ProtectedRoute requiredRoles={['seller']}>
                  <Layout>
                    <Routes>
                      <Route path="/" element={<SellerDashboard />} />
                      <Route path="/listings" element={<SellerDashboard />} />
                      <Route path="/create" element={<SellerDashboard />} />
                    </Routes>
                  </Layout>
                </ProtectedRoute>
              } />
              
              {/* Buyer Routes */}
              <Route path="/buyer/*" element={
                <ProtectedRoute requiredRoles={['buyer']}>
                  <Layout>
                    <Routes>
                      <Route path="/" element={<BuyerDashboard />} />
                      <Route path="/browse" element={<BuyerDashboard />} />
                      <Route path="/orders" element={<BuyerDashboard />} />
                    </Routes>
                  </Layout>
                </ProtectedRoute>
              } />
              
              {/* Appraiser Routes */}
              <Route path="/appraiser/*" element={
                <ProtectedRoute requiredRoles={['appraiser']}>
                  <Layout>
                    <Routes>
                      <Route path="/" element={<AppraiserDashboard />} />
                      <Route path="/evaluations" element={<AppraiserDashboard />} />
                      <Route path="/reports" element={<AppraiserDashboard />} />
                    </Routes>
                  </Layout>
                </ProtectedRoute>
              } />
              
              {/* Admin Routes */}
              <Route path="/admin/*" element={
                <ProtectedRoute requiredRoles={['admin']}>
                  <Layout>
                    <Routes>
                      <Route path="/" element={<AdminDashboard />} />
                      <Route path="/users" element={<AdminDashboard />} />
                      <Route path="/transactions" element={<AdminDashboard />} />
                    </Routes>
                  </Layout>
                </ProtectedRoute>
              } />
              
              {/* Support Routes */}
              <Route path="/support/*" element={
                <ProtectedRoute requiredRoles={['support']}>
                  <Layout>
                    <Routes>
                      <Route path="/" element={<SupportDashboard />} />
                      <Route path="/feedback" element={<SupportDashboard />} />
                      <Route path="/dashboard" element={<SupportDashboard />} />
                    </Routes>
                  </Layout>
                </ProtectedRoute>
              } />
            </Routes>
          </Layout>
        </ProtectedRoute>
      } />
    </Routes>
  );
};

const App = () => {
  return (
    <AuthProvider>
      <AppContent />
    </AuthProvider>
  );
};

export default App;
